    await axios.get(`http://localhost:8080/ESD_Project-1.0-SNAPSHOT/api/salary/history?employee_id=${emp_id.employee_id,month}`)
    .then((response)=>{
        console.log(response.data);
        setRes(response.data);
    })
    .catch(function(error)
    {
        console.log(error);
    });

}
